  return (
    <div>
      <UpdateCounter />
      <DisplayTime />
      <Destructure />
      <EventHandler />
      <SimpleForm />
      <TwoInputForm />
      <ThreeInputForm />
      <ThreeInputSpread />
    </div>
  );
}

export default App;
